            )
          ) THEN 20 ELSE 0 END)
        ELSE 0 END) +
        (CASE WHEN p_job_title IS NOT NULL THEN 
          (CASE WHEN EXISTS (
            SELECT 1 FROM unnest(string_to_array(p_job_title, ',')) AS phrase
            WHERE EXISTS (
              SELECT 1 FROM unnest(regexp_split_to_array(LOWER(trim(phrase)), '\\s+')) AS word
